import React, { useState } from "react";
import { View, Text, StyleSheet, Button, TextInput, Pressable } from "react-native";
import { KeyboardAwareScrollView } from "react-native-keyboard-aware-scroll-view";
import { useSelector } from "react-redux";
import { selectCharacter } from "../redux/features/characterSlice";

export default function HealthScreen() {
	const [character, setCharacter] = useState(useSelector(selectCharacter));

	return (
		<KeyboardAwareScrollView
			style={{ backgroundColor: "#404040" }}
			contentContainerStyle={styles.main}
			showsVerticalScrollIndicator={false}
			bounces={false}
			resetScrollToCoords={{ x: 0, y: 0 }}
			extraScrollHeight={20}>
			<View style={styles.main}>
				<View style={styles.header}>
					<View style={styles.headerTitleContainer}>
						<Text style={styles.headerTitle}>HP Management</Text>
					</View>
				</View>
				<View style={styles.hpContainer}>
					<View style={[styles.hpBox]}>
						<Text style={styles.hpNumber}>{character.health}</Text>
						<Text style={styles.hpText}>Current HP</Text>
					</View>
					<View style={styles.dashBox}>
						<Text style={{ color: "#aaa", fontSize: 35 }}>/</Text>
					</View>
					<View style={[styles.hpBox, { backgroundColor: "#404040" }]}>
						<Text style={styles.hpNumber}>{character.maxHealth}</Text>
						<Text style={styles.hpText}>Maximum HP</Text>
					</View>
					<View style={styles.modContainer}>
						<View style={styles.buttonContainer}>
							<Pressable style={styles.healButton}>
								<Text>Heal</Text>
							</Pressable>
							<TextInput placeholder='num' />
							<Button title='Damage' />
						</View>
						<View>
							<Text style={{ color: "white" }}>Dial</Text>
						</View>
					</View>
				</View>
			</View>
		</KeyboardAwareScrollView>
	);
}

const styles = StyleSheet.create({
	main: {
		backgroundColor: "#404040",
		width: "100%",
		alignItems: "center",
	},
	header: {
		flexDirection: "row",
		justifyContent: "center",
		alignItems: "center",
		backgroundColor: "#303030",
		height: 55,
		width: "100%",
		marginBottom: 30,
	},
	headerTitleContainer: {
		justifyContent: "center",
		alignItems: "center",
	},
	headerTitle: {
		color: "white",
		fontSize: 18,
		fontWeight: "500",
	},
	hpContainer: {
		flexDirection: "row",
		flexWrap: "wrap",
		width: "95%",
		justifyContent: "space-evenly",
		alignItems: "center",
		backgroundColor: "#303030",
	},
	hpBox: {
		flex: 1,
		justifyContent: "center",
		alignItems: "center",
		height: 100,
		width: 150,
	},
	dashBox: {
		justifyContent: "center",
		alignItems: "center",
		height: 100,
		width: 70,
		backgroundColor: "#404040",
	},
	hpNumber: {
		color: "white",
		fontSize: 35,
	},
	hpText: {
		color: "#aaa",
	},
	modContainer: {
		width: "100%",
		flexDirection: "row",
		justifyContent: "space-between",
		alignItems: "center",
		height: 200,
	},
	buttonContainer: {
		flexDirection: "column",
		justifyContent: "space-around",
		alignItems: "center",
	},
	healButton: {
		height: 40,
		width: 100,
		backgroundColor: "green",
		borderRadius: 5,
		justifyContent: "center",
		alignItems: "center",
	},
});
